range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"567528","type":"CustomJS"},{"attributes":{"fill_alpha":0.2,"fill_color":"#ffffea","hatch_alpha":0.2,"line_alpha":0.2,"line_color":"#ffcb66","x":{"field":"index"},"y":{"field":"equity_dd"}},"id":"567221","type":"Patch"},{"attributes":{"line_alpha":{"value":0.1},"line_color":{"value":"#bbbbbb"},"x0":{"field":"index"},"x1":{"field":"index"},"y0":{"field":"High"},"y1":{"field":"Low"}},"id":"567428","type":"Segment"},{"attributes":{"border_line_color":"#333333","click_policy":"hide","coordinates":null,"glyph_width":0,"group":null,"items":[{"id":"567523"}],"label_text_font_size":"8pt","location":"top_left","margin":0,"padding":5,"spacing":0},"id":"567522","type":"Legend"},{"attributes":{},"id":"567158","type":"BasicTicker"},{"attributes":{},"id":"567246","type":"AllLabels"},{"attributes":{"callback":null,"formatters":{"@datetime":"datetime"},"mode":"vline","point_policy":"follow_mouse","renderers":[{"id":"567449"}],"tooltips":[["Date","@datetime{%c}"],["x, y","$index\u00a0\u00a
